import axios from 'axios';
import React, { useState } from 'react'

export const SignUp = () => {

  const [SignUpField, setSignUpField] = useState({
    username : "",
    email : "",
    phone : "",
    password : ""
  })

  const [error, setError] = useState({})

  const handleSignUpChange = (e) => {
    const {name, value} = e.target;
    setSignUpField({...SignUpField, [name] : value})
  }

  const handleSignUpSubmit = async (e) => {
    e.preventDefault()

    try{
      const SignUpResponse = await axios.post("https://dummyjson.com/users/add", SignUpField)

      console.log("SignUpResponse", SignUpResponse)



    }catch(err){
      console.log(err)
    }
  }

  return (
    <div className='signUpForm'>
    <div className='signUpFormHeaing'>
            <h1>TeamUP</h1>
            <p>Please fill in all details</p>
        </div>
        <form>
            <input placeholder='Name' name='username' value={SignUpField.username} onChange={handleSignUpChange}/><br/>   
            <input placeholder='Email address' name='email'  value={SignUpField.email} onChange={handleSignUpChange}/>
            <input placeholder='Phone number' name='phone'  value={SignUpField.phone} onChange={handleSignUpChange}/>
            <input placeholder='Password' name='password'  value={SignUpField.password} onChange={handleSignUpChange}/>
            {/* <input placeholder='Confirm'/> */}
        </form>
        <div className='signUpButton'>
            <button onClick={handleSignUpSubmit}>Signup</button>
        </div>
    </div>
  )
}
export default SignUp;
